def compare_numbers(t, test_cases):
    results = []
    for i in range(t):
        x1, p1, x2, p2 = test_cases[i]

        # Calculate effective lengths
        len1 = len(str(x1)) + p1
        len2 = len(str(x2)) + p2

        # Compare based on effective lengths
        if len1 > len2:
            results.append('>')
        elif len1 < len2:
            results.append('<')
        else:
            # If lengths are equal, compare the numbers directly
            if x1 > x2:
                results.append('>')
            elif x1 < x2:
                results.append('<')
            else:
                results.append('=')

    return results

def main():
    import sys
    input = sys.stdin.read
    data = input().split()

    t = int(data[0])
    index = 1
    test_cases = []

    for _ in range(t):
        x1 = int(data[index])
        p1 = int(data[index + 1])
        x2 = int(data[index + 2])
        p2 = int(data[index + 3])
        test_cases.append((x1, p1, x2, p2))
        index += 4

    results = compare_numbers(t, test_cases)

    for result in results:
        print(result)

if __name__ == "__main__":
    main()
